import React from 'react';

function Child(props) {

    console.log(props);

    var {eid, ename, esal, eaddress}=props
     {eid}-{ename}-{esal}-{eaddress}
    return (<>
    
    <div className='border p-5'>

        <h1>CHILD COMPONENT</h1>

        
      <br />

      <Child
      eid={eid}
      ename={ename}
      esal="54666"
      eaddress="hyderabad" />

    </div>
    </>)
}
